{% load static %}
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>My Shoe Shop</title>
    <!-- Link to Google Fonts -->
    <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:wght@400;700&display=swap" rel="stylesheet">
    <!-- Link to custom CSS -->
    <link rel="stylesheet" href="{% static 'css/style.css' %}">
    <title>{% block title %}Sole Haven | Luxury Footwear{% endblock %}</title>
    <link rel="stylesheet" href="{% static 'css/styles.css' %}">
    <style>
        :root {
            --primary-btn: #D4A5A5;
            --primary-btn-hover: #B38B8B;
        }
        
        .btn {
            padding: 10px 20px;
            background-color: var(--primary-btn) !important;
            color: white !important;
            border: none !important;
            border-radius: 5px !important;
            cursor: pointer;
            font-size: 16px;
            text-align: center;
            text-decoration: none;
            transition: background-color 0.3s;
        }

        .btn:hover {
            background-color: var(--primary-btn-hover) !important;
        }

        .btn-disabled {
            background-color: #ccc !important;
            cursor: not-allowed;
        }
        body {
            margin: 0;
            font-family: Arial, sans-serif;
            display: flex;
        }
        .sidebar {
            width: 220px;
            background-color: #111;
            color: white;
            height: 100vh;
            padding-top: 40px;
            position: fixed;
            z-index: 10;
        }
        .sidebar a {
            display: block;
            color: white;
            padding: 15px 20px;
            text-decoration: none;
        }
        .sidebar a:hover {
            background-color: #000000;
        }
        .main-content {
            margin-left: 220px;
            width: calc(100% - 220px);
            padding: 20px;
            position: relative;
            background: white;
        }
        .main-nav {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 20px 5%;
            border-bottom: 1px solid #eee;
        }
        .header-container {
            display: flex;
            align-items: center;
            padding: 15px 20px;
            background: white;
            border-bottom: 1px solid #eee;
            position: sticky;
            top: 38px; /* Matches announcement height */
            z-index: 90;
        }
        .logo {
            width: 80px;
            height: auto;; 
        }
        .announcement {
            background-color: #FFD6E0;
            text-align: center;
            padding: 10px;
            font-weight: bold;
            position: relative;
            padding-left: 100px; /* Makes space for logo */
        }
        
    </style>
</head>
<body>

    <!-- Sidebar -->
    <div class="sidebar">
        <h2 style="text-align: center; margin-bottom: 30px;">Sole Haven</h2>
        <a href="{% url 'home' %}" class="home-link">Home</a>
        <a href="{% url 'luxury-gallery' %}">View Products</a>
        <a href="{% url 'cart' %}">Cart</a>
        <a href="{% url 'order_history' %}">View History</a>
        <a href="{% url 'login' %}">Login</a>
        <a href="{% url 'register' %}">Register</a>
        <a href="/logout/">Logout</a>
    </div>

    <!-- Main content area -->
    <div class="main-content">
        <!-- Content Wrapper -->
        <div class="content-wrapper">
            <!-- Optional top nav -->
            <div class="announcement">౨ৎ SOLE HAVEN ౨ৎ</div>
